import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEnvelopeOpen } from "@fortawesome/free-solid-svg-icons";

import {
  Button,
  Grid,
  Typography
} from "@mui/material";

const Servicos = (props) => {
  let lista_servicos = [];
  props.servicos.forEach((s, i) => {
    lista_servicos = [
      ...lista_servicos,
      <Grid>
        <Grid>
          <Button
            variant="contained"
            key={i}
            onClick={() => {
              props.ir_para_pagina(s.id);
            }}
          >
            {" "}
            <FontAwesomeIcon icon={faEnvelopeOpen} />
          </Button>
        </Grid>
        <Grid>{s.id}</Grid>
        <Grid>{s.prioridade}</Grid>
        <Grid>{s.assunto}</Grid>
        <Grid>{s.departamento}</Grid>
        <Grid>{s.status}</Grid>
      </Grid>
    ];
  });

  return (
      <Typography>
      <Grid container width={1}>
        <Grid>
          <Grid>
            <Grid>Navegar</Grid>
            <Grid>ID</Grid>
            <Grid>Import√¢ncia</Grid>
            <Grid>Assunto</Grid>
            <Grid>Departamento</Grid>
            <Grid>Status</Grid>
          </Grid>
        </Grid>
        <Grid>{lista_servicos}</Grid>
      </Grid>
      </Typography>
  );
};

export default Servicos;
